val numIterations = 20

val costs = scala.collection.mutable.ArrayBuffer.empty[Double]

for (numClusters <- 2 to 5) {
  val clusters = KMeans
    .train(data, numClusters, numIterations)
  costs += clusters.computeCost(data)
}

println("%table x\ty")
costs
  .zipWithIndex
  .foreach(r => {
    println(Seq(r._2 + 2, r._1).mkString("\t"))
  })
